export enum enumMedia {
    FACEBOOK = "FACEBOOK",
    LINE = "LINE",
    GOOGLE = "GOOGLE",
    PHONE = "PHONE",
    EMAIL = "EMAIL",
}

export enum enumTypeAdditionalFields {
    SINGLE = "SINGLE",
    MULTI = "MULTI",
}

export enum enumStatus {
    ACTIVE = "ACTIVE",
    INACTIVE = "INACTIVE",
    DELETED = "DELETED",
}
